// chatbotApi.js

import axios from "axios";

const API_URL = "http://localhost:5001"; // üö® Er dette riktig backend-url?

export const saveData = async (consent, data) => {
  try {
    await axios.post(`${API_URL}/save`, { consent, data });
  } catch (error) {
    console.error("Feil ved lagring av data:", error);
  }
};

export const clearBackendData = async () => {
  try {
    await axios.post(`${API_URL}/clear`);
  } catch (error) {
    console.error("Feil ved t√∏mming av data:", error);
  }
};

